PRAGMA foreign_keys = ON;

CREATE TABLE acordos (
  id                integer not null primary key
, unidade_id        integer NOT NULL
, total_devido      numeric(10,2) NOT NULL
, total_acrescimo   numeric(10,2) NOT NULL default '0.00'
, desconto          numeric(10,2) default NULL
, total_geral       numeric(10,2) NOT NULL
, em_aberto         numeric(10,2) NOT NULL default '0.00'
, total_acordado    numeric(10,2) NOT NULL
, valor_entrada     numeric(10,2) NOT NULL default '0.00'
, dta_entrada       date NOT NULL
, qtd_parcelas      integer NOT NULL default '1'
, usuario_id        integer NOT NULL
, created           timestamp default NULL
, modified          timestamp default NULL
, FOREIGN KEY(unidade_id)   REFERENCES unidades(id)
, FOREIGN KEY(usuario_id)   REFERENCES usuarios(id)
);



CREATE TABLE arquivos_retorno (
  id                integer not null primary key
, dta_gravacao      date NOT NULL
, arquivo           varchar(64) NOT NULL
, processado        boolean NOT NULL default 0
, created           timestamp NOT NULL
, modified timestamp NOT NULL
);
CREATE INDEX i_arquivos_retorno_dta_gravacao    ON arquivos_retorno(dta_gravacao);
CREATE INDEX i_arquivos_retorno_arquivo         ON arquivos_retorno(arquivo);
CREATE INDEX i_arquivos_retorno_processado      ON arquivos_retorno(processado);



CREATE TABLE bancos (
  id                integer not null primary key
, cod               varchar(4) default NULL
, descricao         varchar(64) NOT NULL
, created           timestamp default NULL
, modified          timestamp default NULL
);
CREATE UNIQUE INDEX i_bancos_codigo     ON bancos(cod);



CREATE TABLE instrucoes_boleto (
  id                integer not null primary key
, texto             text NOT NULL
, descricao         varchar(64) default NULL
, tipo_lancamento_id integer NOT NULL default '-1'
, created           timestamp default NULL
, modified          timestamp default NULL
, FOREIGN KEY(tipo_lancamento_id)   REFERENCES lancamentos(cod)
);
CREATE INDEX i_instrucoes_boleto_descricao          ON instrucoes_boleto(descricao);
CREATE INDEX i_instrucoes_boleto_tipo_lancamento_id ON instrucoes_boleto(tipo_lancamento_id);



CREATE TABLE lancamentos (
  id                integer not null primary key
, mes_ano           varchar(7) NOT NULL
, unidade_id        integer NOT NULL
, tipo_lancamento_id integer NOT NULL default '0'
, dta_vencimento    date NOT NULL
, valor_documento   numeric(10,2) NOT NULL
, taxa_id           integer default NULL
, multa_id          integer default NULL
, instrucao_boleto_id integer default NULL
, usuario_id        integer NOT NULL
, acordo_id         integer default NULL
, created           timestamp default NULL
, modified          timestamp default NULL
, total_parcelas    integer NOT NULL default '1'
, FOREIGN KEY(unidade_id)           REFERENCES unidades(id)
, FOREIGN KEY(tipo_lancamento_id)   REFERENCES tipos_lancamento(id)
, FOREIGN KEY(taxa_id)              REFERENCES taxas(id)
, FOREIGN KEY(multa_id)             REFERENCES multas(id)
, FOREIGN KEY(instrucao_boleto_id)  REFERENCES instrucoes_boleto(id)
, FOREIGN KEY(usuario_id)           REFERENCES usuarios(id)
);
CREATE INDEX i_lancamentos_mes_ano              ON lancamentos(mes_ano);
CREATE INDEX i_lancamentos_dta_vencimento       ON lancamentos(dta_vencimento);
CREATE INDEX i_lancamentos_unidade_id           ON lancamentos(unidade_id);



CREATE TABLE multas (
  id                integer not null primary key
, tipo_multa_id     integer NOT NULL
, motivo            varchar(64) default NULL
, proprietario_id   integer NOT NULL
, valor_total       numeric(10,2) NOT NULL
, created           timestamp default NULL
, modified          timestamp default NULL
, FOREIGN KEY(tipo_multa_id)    REFERENCES tipos_multa(id)
, FOREIGN KEY(proprietario_id)  REFERENCES proprietarios(id)
);



CREATE TABLE pagamentos (
  id                integer not null primary key
, dta_pagamento     date NOT NULL
, valor_documento   numeric(10,2) NOT NULL
, valor_desconto    numeric(10,2) NOT NULL default '0.00'
, valor_acrescimo   numeric(10,2) NOT NULL default '0.00'
, valor_pago        numeric(10,2) NOT NULL
, lancamento_id     integer default NULL
, parcela           integer NOT NULL default '1'
, cheque            numeric(10,2) default '0.00'
, cheque_dia        date default NULL
, cheque_banco_id   integer default NULL
, cheque_info       text
, compensacao       boolean default 0
, arquivo_retorno_id integer default NULL
, linha_arquivo     integer default NULL
, usuario_id        integer NOT NULL
, created           timestamp default NULL
, modified          timestamp default NULL
, FOREIGN KEY(lancamento_id)        REFERENCES lancamentos(id)
, FOREIGN KEY(cheque_banco_id)      REFERENCES bancos(id)
, FOREIGN KEY(arquivo_retorno_id)   REFERENCES arquivos_retorno(id)
, FOREIGN KEY(usuario_id)           REFERENCES usuarios(id)
);
CREATE INDEX i_pagamentos_lancamento_id ON pagamentos(lancamento_id);
CREATE INDEX i_pagamentos_dta_pagamento ON pagamentos(dta_pagamento);



CREATE TABLE parcelas_acordo (
  id                integer not null primary key
, acordo_id         integer NOT NULL
, parcela           integer NOT NULL
, valor             integer NOT NULL
, dta_vencimento    date NOT NULL
, dta_pagamento     date NOT NULL
, usuario_id        integer NOT NULL
, created           timestamp default NULL
, modified          timestamp default NULL
);



CREATE TABLE proprietarios (
  id                integer not null primary key
, nome              varchar(64) NOT NULL
, rg                varchar(64) default NULL
, cpf_cnpj          varchar(14) NOT NULL
, endereco          varchar(64) NOT NULL
, bairro            varchar(64) NOT NULL
, cep               varchar(8)  NOT NULL
, cidade            varchar(64) NOT NULL
, uf                varchar(2)  NOT NULL
, fone1             varchar(10) NOT NULL
, fone2             varchar(10) default NULL
, celular           varchar(10) default NULL
, email             varchar(64) default NULL
, conjuge_nome      varchar(64) default NULL
, conjuge_rg        varchar(64) default NULL
, conjuge_cpf       varchar(14) default NULL
, conjuge_endereco  varchar(64) default NULL
, conjuge_bairro    varchar(64) default NULL
, conjuge_cep       varchar(8)  default NULL
, conjuge_cidade    varchar(64) default NULL
, conjuge_uf        varchar(2)  default NULL
, conjuge_fone1     varchar(10) default NULL
, conjuge_fone2     varchar(10) default NULL
, conjuge_celular   varchar(10) default NULL
, conjuge_email     varchar(10) default NULL
, created           timestamp default NULL
, modified          timestamp default NULL
);
CREATE UNIQUE INDEX i_proprietarios_cpf_cnpj ON proprietarios(cpf_cnpj);
CREATE INDEX i_proprietarios_nome            ON proprietarios(nome);




CREATE TABLE quadras (
  id                integer not null primary key
, abbr              varchar(3) default NULL
, descricao         varchar(64) NOT NULL
, total_lotes       integer default NULL
, created           timestamp default NULL
, modified          timestamp default NULL
);



CREATE TABLE ruas (
  id                varchar(3) NOT NULL
, descricao         varchar(64) NOT NULL
, ordem             integer NOT NULL default '1'
, created           timestamp default NULL
, modified timestamp default NULL
);



CREATE TABLE schema_migrations (
  id                integer not null primary key
, version           integer default NULL
, classname         varchar(128) default NULL
, created           integer default NULL
);



CREATE TABLE taxas (
  id                integer not null primary key
, ref               varchar(8) NOT NULL
, dta_assembleia    date NOT NULL
, motivo            varchar(64) NOT NULL
, valor_total       numeric(10,2) NOT NULL
, qtd_parcelas      integer NOT NULL default '1'
, created           timestamp default NULL
, modified          timestamp default NULL
);



CREATE TABLE tipos_lancamento (
  id                integer not null primary key
, cod               integer NOT NULL
, descricao         varchar(64) NOT NULL
, created   timestamp default NULL
, modified timestamp default NULL
);
CREATE UNIQUE INDEX i_tipos_lancamento_cod  ON tipos_lancamento(cod);




CREATE TABLE tipos_multa (
  id                integer not null primary key
, descricao         varchar(64) NOT NULL
, created           timestamp default NULL
, modified          timestamp default NULL
);



CREATE TABLE unidades (
  id                integer not null primary key
, rua_id            varchar(3) NOT NULL
, quadra_id         integer NOT NULL
, lote              integer NOT NULL
, proprietario_id   integer NOT NULL
, morador_nome      varchar(64) default NULL
, morador_rg        varchar(64) default NULL
, morador_cpf       varchar(14) default NULL
, morador_fone1     varchar(10) default NULL
, morador_fone2     varchar(10) default NULL
, morador_celular   varchar(10) default NULL
, morador_email     varchar(64) default NULL
, morador_obs       varchar(255) default NULL
, created           timestamp default NULL
, modified          timestamp default NULL
, FOREIGN KEY(rua_id)           REFERENCES ruas(id)
, FOREIGN KEY(quadra_id)        REFERENCES quadras(id)
, FOREIGN KEY(proprietario_id)  REFERENCES proprietarios(id)
);



CREATE TABLE usuarios (
  id            integer not null primary key
, usuario       varchar(16) NOT NULL
, senha         varchar(40) NOT NULL
, nome_completo varchar(64) default NULL
, online        boolean NOT NULL default 0
, created       timestamp default NULL
, modified      timestamp default NULL
);
CREATE UNIQUE INDEX i_usuarios_usuario ON usuarios(usuario);


UPDATE usuarios set nome_completo=upper(nome_completo);






